import './Blast.css'
import axios from 'axios'
import { useForm } from 'react-hook-form'
import {useEffect, useState} from 'react'

const Blast = () => {

const [databases, getDatabases] = useState()

const getMany = (Db, hook) => {
	axios.get(`http://192.168.1.37:8080/db/${Db}`).then(res => { hook(res.data.map(entry => { 
		return <option key={entry._id} value={entry.name}>{entry.name}|{entry.type}</option> })) })
}

useEffect(getMany, [])

	return (
		<div className='Blast'>
			<form >
				<select>
					<option value="blastn">blastn</option>
					<option value="blastp">blastp</option>
					<option value="blastx">tblastn</option>
					<option value="blastn">tblastp</option>	
					<option value="blastn">tblastx</option>
				</select>
				<input type="text" id='QuerySubject'/>
				<input type="file" id='Subject' multiple/>
				<input type="text" id='DataQuery'/>
				<select>
					{ databases }
				</select>
				<input type="submit"/>
			</form>
		</div>
	)
}

export default Blast
